import { Component } from "react";
import LoginA from "../Pages/login";
import { Routes, Route } from "react-router-dom";
class Routers extends Component{
    render(){
        return(
            <Routes>
                <Route path="/" element={<LoginA />}  />
            </Routes>
        )
    }
}
export default Routers;
